import { useForm } from "react-hook-form";
import React from "react";
import { Link } from "react-router-dom";

const Sitemap = () => {
    
    return(
        <div className="sitemap">
            <h1 style={{fontWeight: "lighter"}}>Navigation</h1>
            <br /><Link to="/" style={{color: 'none', textDecoration: 'none'}}>Home</Link>
            <br /><Link to="/create" style={{color: 'none', textDecoration: 'none', padding: '20px 5px', width:300, margin:"20px auto"}}>Create</Link>
            <br /><Link to="/browse" style={{color: 'none', textDecoration: 'none', padding: '20px 5px', width:300, margin:"20px auto"}}>Browse</Link>
            <br /><Link to="/login" style={{color: 'none', textDecoration: 'none', padding: '20px 5px', width:300, margin:"20px auto"}}>Sign Up</Link>

        </div>
        
    );
}

export default Sitemap
